Here's the Java code that I'm trying to analyze
public class Ca {

	void m(){
		List s = new ArrayList();
		s.add(this);
	}
}

I am having problems getting the IMethod associated with List.add(Object). The IMethod I get using IType.getMethod(String, String[]) returns false for exists(). So I follow up with a IType.findMethods(IMethod) which returns null.

The problem seems to be that my instance of the add method gets typed as java.util.List::add(Ca) which doesnt exists in java.util.List. The one in the JDT model looks more like java.util.List::add(<E>). Hence the IType.findMethods(IMethod) returns null.

If I change my test code to look like this ...

public class Ca {

	void m(){
		List<Ca> s = new ArrayList<Ca>();
		s.add(this);
	}
}

... I can't even process the ArrayList constructor. That's because I can't get a valid IMethod for the constructor. There's no match for ArrayList<Ca> in the list of constructors for ArrayList and the appropriate one to use is ArrayList<E> but IType.findMethods(IMethod) doesn't make that connection.

This problem appears across other generic types (Map etc). Any way to work around it? I am working with the ASTNode associated with the methodCall and I need to get the IMethod associated with the target method called on the binary generic type.

The Java model doesn't have any resolved information. It is just a model on the source.
Instead, if you have the resolved AST node in hands, I would suggest to use: MethodRef methodCall == ... IBinding methodBinding = methodCall.resolveBinding(); // you need to setResolveBinding(true) on the parser to get a non-null value IMethod method = (IMethod) methodBinding.getJavaElement();
Please reopen if this doesn't suit your needs.

