I think the problem might be due to a mismatch between the system property name used by eclipse and axis transport (which UDDIProxy uses) for the proxy username.  Eclipse stores the name in the "http.proxyUserName" property, while axis tries to retrieve the name from the "http.proxyUser" property.

The following lines of code were added before the find_business call to illustrate this (also the scenario works with this change since http.proxyUser is set to the same value as http.proxyUserName):

