Package org.eclipse.cdt.internal.core;

I have a problem when handling japanese logfiles. When making a system call to commandlauncher, for example "type japanese.log" the ProcessClosure.java gets bytes with shift-jis charset(japanese). When doing Reader.readline() the bytes is changed from the original charset to my local charset. In earlier versions of cdt there where no reader.readline(), instead inputstream.read() was used (I think). 

Example. CDT 4.0
ProcessClosure.java -> run method.

BufferedReader reader = new BufferedReader(new InputStreamReader(fInputStream));
String line;
while ((line = reader.readLine()) != null) {
line += lineSeparator;
fOutputStream.write(line.getBytes());
}

Working Example 
byte[] buffer= new byte[512];
while (true) {
int n= fInputStream.read(buffer);
if (n < 0) {
return;
}
if (fOutputStream != null) {
fOutputStream.write(buffer, 0, n);					
fOutputStream.flush();
}
}

BD 81 42 0D 0A will become BD 3F 42 OD OA when going through the processclosure->Reader.readline();

Conclusion.
Must of the time the current implementation of ProcessClosure.java works. 
But changing charset in the middle of the flow is maybe not correct. I think the view should decide what charset to use.

